import { useRef, useState } from 'react'

function LoginAccount() {
  const width = useRef(window.innerWidth).current
  const height = useRef(window.innerHeight).current
  return (
    <div>
      <div
        style={{
          display: 'flex',
          height: height * 0.09,
          backgroundColor: '#171544',
          flexDirection: 'row',
        }}
      >
        <div
          style={{
            height: height * 0.09,
            width: width * 0.2,
            backgroundColor: 'red',
          }}
        ></div>
      </div>
    </div>
  )
}

export default LoginAccount
